import Head from 'next/head';

const Meta = () => (
    <Head>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta charSet="utf-8" />
    <title>Doggos</title>
    <style jsx global>{`
      body {
        margin: 0;
        padding: 0;
      }
		`}</style>
    </Head>
);

export default Meta;
